import Task from "./Task"

const Tasks = ({tasks, deleteTask}) => {
  return (
    <div>
      {tasks.map((task)=>
      <Task key={task.id} task ={task}  onDelete={deleteTask}/>
      )}
    </div>
  )
}

export default Tasks
